  false,\n\t\"url\": null,\n\t\"notes\": \"This was a special research project, funded
  by NMFS and conducted by DAWR, designed to obtain virgin stock type catch, effort,
  species composition, and size frequency data for a virtually unfished small bank
  about 117 miles west of Guam and to compare those statistics with similar statistics
  collected from more heavily fished banks south of Guam.  Catch and effort, species
  IDs, and length and weight for all fish obtained from intense, but short lived,
  fishing operations on the banks were collected and entered into a database.  The
  main idea was to create virgin stock SPR parameters for the shallow bottom reef
  fish complex harvested by local fishers.  WPacFIN can provide the exact dates of
  the projects. These data are considered confidential.\",\n\t\"license_title\": null,\n\t\"extras\":
